// src/components/MovieList.js
import React from 'react';

const MovieList = ({ movies }) => {
    return (
        <div>
            {movies.length === 0 ? (
                <p>No movies found</p>
            ) : (
                <ul>
                    {movies.map(movie => (
                        <li key={movie.id}>
                            <h3>{movie.title}</h3>
                            <p>{movie.overview}</p>
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default MovieList;
